description:
This is energetic project can be great for last minute intro. This one comes with stunning, sparks, particles, flares, fire, smoke, and 3d text titles---all done if After Effects. I have used Optical Flare plug-in, but you don't have to own it--since I have included 2 projects. A project with plug-ins, and the other without plug-ins. On this one you can insert up to 8 text titles of your choice. I have pre-comps most most of the layers, so that you can easily add, customize your text titles. To add your text, just click on the folder called Add Your Text Titles Here---it's that easy. 1920x1080 Only Sounds Effects mix are included,

